create table drivers (
                         id INT NOT NULL AUTO_INCREMENT,
                         first_name VARCHAR(50),
                         last_name VARCHAR(50),
                         email VARCHAR(50),
                         street VARCHAR(50),
                         city VARCHAR(50),
                         state VARCHAR(8),
                         licenseNumber VARCHAR(40),
                         licenseExpire VARCHAR(50),
                         PRIMARY KEY (`id`)
);
